(2,	'{\"boekjaar\":2023,\"naam_bedrijf\":\"CURA Glass B.V.\",\"iban_nummer\":\"NL45RABO0143615505\",\"first_name\":\"Raymond\",\"middle_name\":null,\"last_name\":\"Koopman\",\"email\":\"administratie@cura-glass.nl\",\"course\":\"Ja\",\"naam_cursus\":null,\"cursus_info\":\"\",\"naam_opleidingsinstituut\":\"ARBO Centrum\",\"datum_cursus_van\":\"2023-02-23\",\"datum_tot\":\"2023-02-23\",\"subsidiepercentage_dat_van_toepassing_is\":100,\"totaalbedrag_subsidie_aanvraag\":345,\"aard_van_de_cursus\":\"Open inschrijving\",\"factuur\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2023\\/03\\/Veilig-werken-met-een-heftruck-R.-Trelinski-Factuur.pdf\",\"certificaat\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2023\\/03\\/Veilig-werken-met-een-heftruck-R.-Trelinski-Certificaat.pdf\",\"deelnemers\":\"Minder dan 10\",\"verklaring\":1,\"data_deelnemerslijst\":{\"1\":{\"first_name\":\"R\",\"middle_name\":null,\"last_name\":\"Trelinski\",\"geboortedatum_werknemer_dd\":\"02\",\"geboortedatum_werknemer_mm\":\"07\",\"geboortedatum_werknemer_jjjj\":\"1976\"}},\"aantal_deelnemers_in_cursus\":1,\"informatie_over_het_opleidingsinstituut\":null,\"deelnemersinfo_per_bestand\":null}',	4294,	'administratie@cura-glass.nl',	0,	'2023-03-28 12:18:05',	'2023-12-06 10:26:58',	2602,	1,	0,	345,	0,	22,	500051,	NULL,	NULL),
(2,	'{\"boekjaar\":2023,\"naam_bedrijf\":\"CURA Glass B.V.\",\"iban_nummer\":\"NL45RABO0143615505\",\"first_name\":\"Raymond\",\"middle_name\":null,\"last_name\":\"Koopman\",\"email\":\"administratie@cura-glass.nl\",\"course\":\"Nee\",\"naam_cursus\":null,\"cursus_info\":\"Tijdens deze klassikale cursus, waarin theorie en praktijk elkaar afwisselen, leer je de basis om goed te werken met Excel. Je leert om getallen en datums in te voeren en eenvoudige berekeningen te maken. Ook het opmaken van werkbladen en cellen is onderdeel van deze cursus. Daarnaast leer je hoe je werkbladen overzichtelijk kunt afdrukken. Tijdens de cursus wordt gebruikgemaakt van Excel 2016. Werk je met Excel 2013 of Excel 2019, dan is deze cursus ook zeer geschikt voor jou. Tijdens de cursus kun je kiezen of je met de Nederlandse of Engelse versie van het programma wilt werken.\",\"naam_opleidingsinstituut\":\"Ises Computrain Trainingen B.V.\",\"datum_cursus_van\":\"2023-02-15\",\"datum_tot\":\"2023-02-16\",\"subsidiepercentage_dat_van_toepassing_is\":50,\"totaalbedrag_subsidie_aanvraag\":445,\"aard_van_de_cursus\":\"Open inschrijving\",\"factuur\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2023\\/03\\/Excel-Basis-S.-Linnenbank-Factuur.pdf\",\"certificaat\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2023\\/03\\/Excel-Basis-S.-Linnenbank-Certificaat.pdf\",\"deelnemers\":\"Minder dan 10\",\"verklaring\":1,\"data_deelnemerslijst\":{\"1\":{\"first_name\":\"S\",\"middle_name\":null,\"last_name\":\"Linnenbank - Dekker\",\"geboortedatum_werknemer_dd\":\"13\",\"geboortedatum_werknemer_mm\":\"03\",\"geboortedatum_werknemer_jjjj\":\"1981\"}},\"aantal_deelnemers_in_cursus\":1,\"informatie_over_het_opleidingsinstituut\":\"Computrain is opgericht toen de meeste werknemers nog niet met een eigen pc werkten. We zagen toen al dat informatietechnologie grote veranderingen bracht bij bedrijven. Inmiddels is de wereld van communiceren en werken inderdaad totaal veranderd. De voortdurende IT-vernieuwingen be\\u00efnvloeden hoe wij IT gebruiken, en ze zijn steeds bepalender voor de bedrijfsresultaten. Dit heeft impact op de IT-arbeidsmarkt en de vraag naar kennis, vaardigheden en gedrag (competenties). Voor zowel de IT-professional en de IT-gebruiker als het management.\",\"deelnemersinfo_per_bestand\":null}',	4293,	'administratie@cura-glass.nl',	0,	'2023-03-28 12:05:53',	'2023-12-06 10:26:58',	2602,	1,	0,	445,	0,	22,	500051,	NULL,	NULL),
(2,	'{\"boekjaar\":2022,\"naam_bedrijf\":\"CURA Glass B.V.\",\"iban_nummer\":\"NL45RABO0143615505\",\"first_name\":\"Raymond\",\"middle_name\":null,\"last_name\":\"Koopman\",\"email\":\"Administratie@cura-glass.nl\",\"course\":\"Nee\",\"naam_cursus\":null,\"cursus_info\":\"Tijdens de Regionale Salarisdagen hoort u alle maatregelen die op Prinsjesdag bekendgemaakt worden. Dat betekent dat u bijgepraat wordt over alle nieuwe wet- en regelgeving op het gebied van loonheffingen, sociale zekerheid, pensioenen en arbeidsrecht.\",\"naam_opleidingsinstituut\":\"Rendement Uitgeverij BV\",\"datum_cursus_van\":\"2022-12-08\",\"datum_tot\":\"2022-12-08\",\"subsidiepercentage_dat_van_toepassing_is\":50,\"totaalbedrag_subsidie_aanvraag\":\"232.5\",\"aard_van_de_cursus\":\"Open inschrijving\",\"factuur\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2023\\/01\\/Regionale-Salarisdagen-2022_Factuur.pdf\",\"certificaat\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2023\\/01\\/Regionale-Salarisdagen-2022_Certificaat.pdf\",\"deelnemers\":\"Minder dan 10\",\"verklaring\":1,\"data_deelnemerslijst\":{\"1\":{\"first_name\":\"REJJ\",\"middle_name\":null,\"last_name\":\"Koopman\",\"geboortedatum_werknemer_dd\":\"03\",\"geboortedatum_werknemer_mm\":\"02\",\"geboortedatum_werknemer_jjjj\":\"1969\"}},\"aantal_deelnemers_in_cursus\":1,\"informatie_over_het_opleidingsinstituut\":\"Rendement Uitgeverij is een multimediale uitgever van vakinformatie. Een echte Rotterdamse uitgeverij waar medewerkers hun handen uit de mouwen steken. Met zestig man werken we aan mooie producten en diensten die u helpen in uw vakgebied. En dat doen we al meer dan 20 jaar. Inmiddels informeren wij tienduizenden professionals over belangrijke wet- en regelgeving op hun vakgebied. _x000D_\\n_x000D_\\nBij Rendement maken we vakbladen, boeken, online content, zoals naslagwerken en tools, nieuwsbrieven en opleidingen & congressen voor professionals in tien vakgebieden. Van personeelszaken tot financi\\u00ebn, van salarisadministratie tot arbo. We zitten bovenop nieuwe ontwikkelingen in wet- en regelgeving.\",\"deelnemersinfo_per_bestand\":null}',	4092,	'Administratie@cura-glass.nl',	0,	'2023-01-24 14:48:43',	'2023-12-06 10:26:58',	2602,	0,	0,	116.25,	0,	22,	500051,	NULL,	NULL),
(2,	'{\"boekjaar\":2022,\"naam_bedrijf\":\"CURA Glass B.V.\",\"iban_nummer\":\"NL45RABO0143615505\",\"first_name\":\"Raymond\",\"middle_name\":null,\"last_name\":\"Koopman\",\"email\":\"Administratie@cura-glass.nl\",\"course\":\"Nee\",\"naam_cursus\":null,\"cursus_info\":\"Nederlands als Tweede Taal (vaak aangeduid als NT2) is de verzamelnaam voor alle taaltrainingen Nederlands voor cursisten die het Nederlands niet als moedertaal hebben._x000D_\\n_x000D_\\nOnze trainingen NT2 zijn op maat gemaakte trainingen. Voor expats zal een training gericht zijn op dagelijkse taalbeheersing, sociale conventies en culturele aspecten, terwijl een training \\u2018Dutch in the workplace\\u2019 meer gericht zal zijn op gezondheid, veiligheid, technologie, werkinstructies en machineonderdelen.\",\"naam_opleidingsinstituut\":\"De Taaltrainer B.V.\",\"datum_cursus_van\":\"2022-02-17\",\"datum_tot\":\"2022-06-09\",\"subsidiepercentage_dat_van_toepassing_is\":100,\"totaalbedrag_subsidie_aanvraag\":2196,\"aard_van_de_cursus\":\"Incompany\",\"factuur\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2022\\/11\\/Zakelijk-Nederlands-Bielak-Jozwiak-Kozlowski_Factuur.pdf\",\"certificaat\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2022\\/11\\/Zakelijk-Nederlands-Bielak-Jozwiak-Kozlowski_Certificaat.pdf\",\"deelnemers\":\"Minder dan 10\",\"verklaring\":1,\"data_deelnemerslijst\":{\"1\":{\"first_name\":\"JM\",\"middle_name\":null,\"last_name\":\"Bielak\",\"geboortedatum_werknemer_dd\":\"25\",\"geboortedatum_werknemer_mm\":\"05\",\"geboortedatum_werknemer_jjjj\":\"1976\"},\"2\":{\"first_name\":\"A\",\"middle_name\":null,\"last_name\":\"Jozwiak\",\"geboortedatum_werknemer_dd\":\"17\",\"geboortedatum_werknemer_mm\":\"09\",\"geboortedatum_werknemer_jjjj\":\"1989\"},\"3\":{\"first_name\":\"S\",\"middle_name\":null,\"last_name\":\"Kozlowski\",\"geboortedatum_werknemer_dd\":\"25\",\"geboortedatum_werknemer_mm\":\"07\",\"geboortedatum_werknemer_jjjj\":\"1986\"}},\"aantal_deelnemers_in_cursus\":3,\"informatie_over_het_opleidingsinstituut\":\"Als je de taal spreekt van je zakenpartners, collega\\u2019s of leveranciers dan zul je merken dat de samenwerking soepeler en succesvoller verloopt. Je productiviteit neemt toe, je neemt een voorsprong op je concurrentie \\u00e9n je investeert in jezelf en je bedrijf._x000D_\\n_x000D_\\nBij De Taaltrainer begrijpen we dat goede communicatie de sleutel is tot succes. We helpen je graag om je taal- en communicatieskills naar een hoger niveau te tillen. Dit heeft de volgende voordelen:_x000D_\\n_x000D_\\nJe hebt meer zelfvertrouwen_x000D_\\nJe komt professioneler en betrouwbaarder over_x000D_\\nJe begrijpt je gesprekspartners beter en daardoor verlies je geen tijd of geld meer aan miscommunicatie\",\"deelnemersinfo_per_bestand\":null}',	4036,	'Administratie@cura-glass.nl',	0,	'2022-11-23 11:06:33',	'2023-12-06 10:26:58',	2602,	0,	0,	2196,	0,	22,	500051,	NULL,	NULL),
