(2,	'{\"boekjaar\":2022,\"naam_bedrijf\":\"CURA Glass B.V.\",\"iban_nummer\":\"NL45RABO0143615505\",\"first_name\":\"Raymond\",\"middle_name\":null,\"last_name\":\"Koopman\",\"email\":\"Administratie@cura-glass.nl\",\"course\":\"Nee\",\"naam_cursus\":null,\"cursus_info\":\"Je woont en werkt in Nederland, maar de Nederlandse taal is niet je moedertaal. In je werk spreek je voornamelijk Nederlands, maar dit is niet altijd vloeiend. Je wilt daarom je zakelijk Nederlands verbeteren en daarmee zelfverzekerder gesprekken voeren en zaken doen. In deze resultaatgerichte training wordt aandacht besteed aan een aantal belangrijke vaardigheden, zoals presenteren in het Nederlands en het voeren van zakelijke onderhandelingen. Daarnaast leer je meer over cultuurkenmerken van Nederlanders in een zakelijke omgeving. Na deze training kun jij op je Nederlands vertrouwen in je werk.\",\"naam_opleidingsinstituut\":\"NCOI Opleidingen\",\"datum_cursus_van\":\"2022-05-02\",\"datum_tot\":\"2022-05-31\",\"subsidiepercentage_dat_van_toepassing_is\":50,\"totaalbedrag_subsidie_aanvraag\":182350,\"aard_van_de_cursus\":\"Open inschrijving\",\"factuur\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2022\\/11\\/Zakelijk-Nederlands-A.-Wejman_Factuur.pdf\",\"certificaat\":\"https:\\/\\/aanvragen.stoov.nl\\/wp-content\\/uploads\\/gravity_forms\\/10-29eb4d01898a3dfb9caf39d3382b3b74\\/2022\\/11\\/Zakelijk-Nederlands-A.-Wejman_Certificaat.pdf\",\"deelnemers\":\"Minder dan 10\",\"verklaring\":1,\"data_deelnemerslijst\":{\"1\":{\"first_name\":\"A\",\"middle_name\":null,\"last_name\":\"Wejman\",\"geboortedatum_werknemer_dd\":\"13\",\"geboortedatum_werknemer_mm\":\"12\",\"geboortedatum_werknemer_jjjj\":\"1983\"}},\"aantal_deelnemers_in_cursus\":1,\"informatie_over_het_opleidingsinstituut\":\"Werkend Nederland sterk maken en sterk houden. Met die missie is NCOI Opleidingen in 1996 gestart en daar zijn ze vandaag de dag nog steeds mee bezig. Dankzij de unieke NCOI-methode en maximale flexibiliteit behalen hier jaarlijks 20.000 werkenden een (erkend) MBO-, HBO- of Masterdiploma. En met ruim 1.250 opleidingen en trainingen in vrijwel elk vakgebied mag NCOI zich met recht de grootste opleider van werkend Nederland noemen.\",\"deelnemersinfo_per_bestand\":null}',	4031,	'Administratie@cura-glass.nl',	0,	'2022-11-17 10:34:12',	'2023-12-06 10:26:58',	2602,	0,	0,	91175,	0,	22,	500051,	NULL,	NULL),
